#include "prime_list.h"



bool Prime_list::is_prime(u_long n)
{
	if(n <= 1) return false;
	if(n < 4) return true;
	if(n % 2 == 0) return false;
	if(n < 9) return true;

	u_long max_dividor = static_cast<u_long>(sqrt(n));
	u_long divide_by = 5;
	while(divide_by <= max_dividor)
	{
		if(n % divide_by == 0) return false;
		if(n % (divide_by+2) == 0) return false;
		divide_by += 6;
	}

	return true;
}

void Prime_list::run()
{
	int n = 10000;

	std::vector<u_long> primes = std::vector<u_long>(n);

	int i = 1;
	u_long* next = &primes[0];

	*next = 2;
	++next;

	u_long res = 3;
	while(i < n)
	{
		if(is_prime(res))
		{
			*next = res;
			++next;
			i++;
		}
		res += 2;
	}

	for (auto it = primes.begin(); it != primes.end(); ++it)
	{
		std::cout << *it << std::endl;
	}
}

std::vector<int>* Prime_list::get()
{
	return &primes;
}

